import React from 'react'
import Link from 'next/link';

const IndexPage = () => {
  return (
    <div>
      <h1>The Main Page</h1>
      <p>
        Go to <Link href="/auth"><a>Auth</a></Link>
      </p>
    </div>
  )
}

export default IndexPage
